exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog"),url=`https://www.5fsy.com/novelinfo/${bid.idPrefix()}_${bid}.html`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/class="chapterNum"/,"</ul>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};